import { Drawer } from '@mui/material'
import { width } from '@mui/system';
import React from 'react'

const Dashboard = () => {
  return (
    <div style={{display:'flex', height:"100vh", position:"fixed", width:"100%", height:'100%'}}>
    <Drawer
    variant='permanent'
    anchor='left'
    >

    <p>hello dashboard</p>

    </Drawer>

    </div>
  )
}

export default Dashboard;
